import React from 'react';
const TimeTable=()=>{
    return(
        <div className="time-table-container">
            <table>
                <tr>
                    <th>MON</th>
                    <th>TUE</th>
                    <th>WED</th>
                    <th>THU</th>
                    <th>FRI</th>
                    <th>SAT</th>
                    <th>SUN</th>
                </tr>
            </table>
        </div>
    )

}
export default TimeTable;
